import Header from './Components/Header';
import Person from './Components/Person';




function App() {
  return (
    <div className="App">
    <Header/>

    {people.map((item,index)=>
    <Person
      key={index}
      name={item.name}
      height={item.height}
      gender={item.gender}
      age={item.age}
      money={item.money}


    />
    )}
    </div>
  );
}

export default App;
